import React from 'react';
import { Typography, TableContainer, Table, TableRow, TableCell, Paper, Box, Link } from '@mui/material';

const BasicStats = ({ data }) => {
  const columns = [
    { key: 'Sector', value: data.sector },
    { key: 'Industry', value: data.industry },
    { key: 'Exchange', value: data.exchange },
    { key: 'Country', value: data.country_name },
    { key: 'ISIN', value: data.isin },
    { key: 'Primary Ticker', value: data.primary_ticker },
    { key: 'Fiscal Year End', value: data.fiscal_year_end },
    {
      key: 'Web URL',
      value: (
        <Link href={data.web_url} target="_blank" rel="noopener noreferrer">
          Link
        </Link>
      ),
    },
  ];

  return (
    <Paper elevation={3} sx={{ margin: 'auto', overflow: 'hidden', p: 2 }}>
      <Box sx={{ bgcolor: 'primary.main', p: 1 }}>
        <Typography variant="subtitle1" sx={{ color: 'common.white', textAlign: 'center' }}>Basic Statistics</Typography>
      </Box>
      <TableContainer>
        <Table aria-label="Basic Stats Table">
          <TableRow>
            {columns.map((column, index) => (
              <React.Fragment key={index}>
                <TableCell>{column.key}:</TableCell>
                <TableCell>{column.value}</TableCell>
              </React.Fragment>
            ))}
          </TableRow>
        </Table>
      </TableContainer>
    </Paper>
  );
};

export default BasicStats;
